import React from "react";

function AddProductInnerForm(props){


    return (
        <form id={props.id} className="ml-3 border border-dark w-75 p-3">
            <div className="form-group row">
                <label  class="col-sm-3 col-form-label">{props.typeName}</label>
                <div class="col-sm-5">
                    <input type="text" id = {props.typeId} className="form-control" />
                </div>
            </div>
            <p>{props.description}</p>
        </form>
    )

}

export default AddProductInnerForm;
